--DROP SPECIFIC PROCEDURE ENTLIBTEST.GetCustomerTest;

CREATE Procedure ENTLIBTEST.GetCustomerTest
(	
	IN vCustId				VARCHAR(12),
	IN vTest				VARCHAR(12)
)
DYNAMIC RESULT SETS 1 
LANGUAGE SQL 
NOT DETERMINISTIC 
MODIFIES SQL DATA 
CALLED ON NULL INPUT 
SET OPTION COMMIT = *RR
BEGIN 
	
	DECLARE TEMP_CURSOR1 CURSOR WITH HOLD WITH RETURN TO CLIENT FOR 
	SELECT * FROM ENTLIBTEST.CUSTOMERS 
	WHERE CUSTOMERID = vCustId;
	
	OPEN TEMP_CURSOR1; 
END;

--DROP SPECIFIC PROCEDURE ENTLIBTEST.TenMostExpensiveProducts;

CREATE Procedure ENTLIBTEST.TenMostExpensiveProducts()
DYNAMIC RESULT SETS 1 
LANGUAGE SQL 
NOT DETERMINISTIC 
CALLED ON NULL INPUT 
SET OPTION COMMIT = *RR
BEGIN 
	
	DECLARE TEMP_CURSOR1 CURSOR WITH HOLD WITH RETURN TO CLIENT FOR 
	SELECT P.ProductName AS TenMostExpensiveProducts, P.UnitPrice FROM ENTLIBTEST.PRODUCTS P
	ORDER BY UNITPRICE DESC
	FETCH FIRST 10 ROW ONLY;
		
	OPEN TEMP_CURSOR1; 

END;

--DROP SPECIFIC PROCEDURE ENTLIBTEST.ProductSalesByYear;

CREATE Procedure ENTLIBTEST.ProductSalesByYear
(	
	IN vProdName 	VARCHAR(12),
	IN vOrdYear	NUMERIC(5,0)
)
DYNAMIC RESULT SETS 1 
LANGUAGE SQL 
NOT DETERMINISTIC 
MODIFIES SQL DATA 
CALLED ON NULL INPUT 
SET OPTION COMMIT = *RR
BEGIN 
	
	DECLARE TEMP_CURSOR1 CURSOR WITH HOLD WITH RETURN TO CLIENT FOR 
	SELECT ProductName, ROUND(SUM(OD.Quantity * (1-OD.Discount) * OD.UnitPrice), 0) AS TotalPurchase
		FROM ENTLIBTEST.OrderDetails OD, ENTLIBTEST.Orders O, ENTLIBTEST.Products P
		WHERE OD.OrderID = O.OrderID
			AND OD.ProductID = P.ProductID
			AND P.ProductName LIKE '%' || vProdName || '%'
			AND YEAR(ShippedDate) = vOrdYear
		GROUP BY ProductName
		ORDER BY ProductName;
	
	OPEN TEMP_CURSOR1; 

END;

